import React from "react";
class Login extends React.Component {
    constructor(props) {

        super(props);

        this.state = {
            loginSuccess: false,
        }
    }
    render() {
        return <div>
            <GoogleLogin
            onSuccess={credentialResponse => {
                console.log(credentialResponse);

            }}
            onError={() => {
                console.log('Login Failed');
            }}
        />
          {this.state.loginSuccess ?<App /> : null} 
        </div>
    }
}


export default Login;
